    # sample patient mapping based on UNMC logic
    # Note:  you need to change VCLARITY.CLARITY.dbo.PATIENT to point to your clarity table
    # Note:  you need to change Heronloader.dbo.PATIENT_MAPPING to point to your patient maping table, and change field names
    def PatientMapping(self):
        sql = """update TUMOR_PRIVATE SET PATID = pm.PATIENT_NUM
                FROM TUMOR_PRIVATE tp with(nolock)
                inner join VCLARITY.CLARITY.dbo.PATIENT p with(nolock) on tp.MEDICAL_RECORD_NUMBER_N2300 = p.PAT_MRN_ID
                inner join Heronloader.dbo.PATIENT_MAPPING pm with(nolock) on p.PAT_ID = pm.PATIENT_IDE"""
        conn = pyodbc.connect(self._constr)
        cursor = conn.cursor()
        cursor.execute(sql)
        cursor.commit()




    
